import React from "react";

class ContactPage extends React.Component {
  render() {
    return (
      <Container>
        <Jumbotron>
          <h1>Contact us:</h1>
          <p>seansoohyunkwon@gmail.com</p>
        </Jumbotron>
        <Link to="/about">
          <Button bsStyle="primary">About</Button>
        </Link>
      </Container>
    );
  }
}

export default ContactPage;
